        window.toggleCalcMode = function () {
          let calc = document.getElementById( "calc" );
          let calcMode = calc.getAttribute( "mode" );

          if ( calcMode == "adder" ) {
            calc.setAttribute( "mode" , "deleter" );
          } else {
            calc.setAttribute( "mode" , "adder" );
          }

        }

        window.resetCalc = function () {
          var inputs = document.getElementById( "calc" ).getElementsByTagName( "input" );

          for (var i = 0; i < inputs.length; i++) {
            inputs[i].value = 0;
          }

        }

        window.decrement = function ( button ) {
          var input = button.parentElement.getElementsByTagName( "input" )[0];

          if ( input.id.includes( "deleter" ) ) {
            if ( parseInt( input.value || 0 ) <= 0 ) {
              input.value = parseInt( input.value || 0 ) - 1;
              calculation( input );
            }
          } else if ( parseInt( input.value || 0 ) > 0 ) {
            input.value = parseInt( input.value || 0 ) - 1;
            calculation( input );
          }

        }

        window.increment = function ( button ) {
          var input = button.parentElement.getElementsByTagName( "input" )[0];

          if ( input.id.includes( "deleter" ) ) {
            if ( parseInt( input.value || 0 ) < 0 ) {
              input.value = parseInt( input.value || 0 ) + 1;
              calculation( input );
            }
          } else if ( parseInt( input.value || 0 ) >= 0 ) {
            input.value = parseInt( input.value || 0 ) + 1;
            calculation( input );
          }

        }

        window.calculation = function ( input ) {
            if ( input.value > input.max && !input.min ) {
                input.value = input.max;
                return;
            }
            if ( input.value < input.min && !input.max ) {
                input.value = input.min;
                return;
            }
            updateSum();
            localStorage.setItem( (document.title + input.id).hashCode() , input.value );
        }

        window.updateSum = function () {
          var sum = 0;
          var deleteSum = 0;
          var counters = document.getElementById( "calc" ).getElementsByClassName( "control-count" );

          var adders = document.querySelectorAll( ".control-count.adder" );
          var deleters = document.querySelectorAll( ".control-count.deleter" );

          for (var i = 0; i < adders.length; i++) {
            var input = adders[i].getElementsByTagName( "input" )[0];
            sum += parseFloat( input.getAttribute( "price" ) ) * parseFloat( input.value || 0 );
          }

          for (var i = 0; i < deleters.length; i++) {
            var input = deleters[i].getElementsByTagName( "input" )[0];
            deleteSum -= parseFloat( input.getAttribute( "price" ) ) * parseFloat( input.value || 0 );
          }

          document.getElementById( "calc_sum" ).innerHTML = sum.toFixed(2);
          document.getElementById( "calc_deleter_sum" ).innerHTML = deleteSum.toFixed(2);
        }

